import React from 'react';
import { Box, ChakraProvider, extendTheme, Flex } from '@chakra-ui/react';
import { MdEmail } from 'react-icons/md';
import { IoPersonAddOutline } from 'react-icons/io5';
import { BsQuestionLg } from 'react-icons/bs';
import { PiSeal, PiSealFill, PiSealLight } from 'react-icons/pi';

const theme = extendTheme({
  fonts: {
    body: '"Karla Variable", sans-serif',
  },
});

const IconBox = ({
  icon: Icon,
  bgColor = '#00bfff',
  size = '48px',
  containerType = 'box',
  withBorder = true,
  borderThickness = 1,
  doubleBorder = false,
  iconScale = 0.6,
  ...props
}) => {
  const iconSize = `${parseInt(size) * iconScale}px`;

  if (containerType === 'seal') {
    const SealOutlineIcon = borderThickness <= 1 && PiSealLight ? PiSealLight : PiSeal;

    return (
      <Box position="relative" width={size} height={size} {...props}>
        <PiSealFill size={size} color={bgColor} />
        {withBorder && (
          <>
            <Box
              as={SealOutlineIcon}
              size={size}
              color="black"
              position="absolute"
              top="0"
              left="0"
              style={{
                width: size,
                height: size,
              }}
              sx={{
                svg: {
                  strokeWidth: borderThickness,
                  stroke: 'black',
                  fill: 'none',
                },
                path: {
                  strokeWidth: borderThickness,
                  stroke: 'black',
                  fill: 'none',
                },
              }}
            />
            {doubleBorder && (
              <Box
                as={SealOutlineIcon}
                size={`calc(${size} - 4px)`}
                color="black"
                position="absolute"
                top="2px"
                left="2px"
                style={{
                  width: `calc(${size} - 4px)`,
                  height: `calc(${size} - 4px)`,
                }}
                sx={{
                  svg: {
                    strokeWidth: borderThickness,
                    stroke: 'black',
                    fill: 'none',
                  },
                  path: {
                    strokeWidth: borderThickness,
                    stroke: 'black',
                    fill: 'none',
                  },
                }}
              />
            )}
          </>
        )}
        <Flex
          position="absolute"
          top="50%"
          left="50%"
          transform="translate(-50%, -50%)"
          alignItems="center"
          justifyContent="center"
        >
          {Icon ? (
            <Icon size={iconSize} color="black" />
          ) : (
            <BsQuestionLg size={iconSize} color="black" />
          )}
        </Flex>
      </Box>
    );
  } else {
    return (
      <Flex
        width={size}
        height={size}
        bg={bgColor}
        borderRadius="12px"
        alignItems="center"
        justifyContent="center"
        {...props}
      >
        {Icon ? (
          <Icon size={iconSize} color="black" />
        ) : (
          <BsQuestionLg size={iconSize} color="black" />
        )}
      </Flex>
    );
  }
};

const IconBoxExamples = () => {
  return (
    <ChakraProvider theme={theme}>
      <Flex
        gap={4}
        p={4}
        bg="gray.100"
        justifyContent="center"
        alignItems="center"
        flexWrap="wrap"
      >
        {/* Seals with Single Border */}
        <IconBox
          icon={MdEmail}
          bgColor="#00bfff"
          size="64px"
          containerType="seal"
          withBorder={true}
          borderThickness={0.5}
          iconScale={0.5}
        />
        <IconBox
          icon={IoPersonAddOutline}
          bgColor="#b3ebf2"
          size="64px"
          containerType="seal"
          withBorder={true}
          borderThickness={1}
          iconScale={0.5}
        />
        {/* Seals with Double Border */}
        <IconBox
          icon={MdEmail}
          bgColor="#00bfff"
          size="64px"
          containerType="seal"
          withBorder={true}
          borderThickness={0.5}
          doubleBorder={true}
          iconScale={0.5}
        />
        <IconBox
          icon={IoPersonAddOutline}
          bgColor="#b3ebf2"
          size="64px"
          containerType="seal"
          withBorder={true}
          borderThickness={1}
          doubleBorder={true}
          iconScale={0.5}
        />
        {/* Seals without Border */}
        <IconBox
          icon={MdEmail}
          bgColor="#00bfff"
          size="64px"
          containerType="seal"
          withBorder={false}
          iconScale={0.5}
        />
        {/* Original Box Example */}
        <IconBox
          icon={MdEmail}
          bgColor="#00bfff"
          size="48px"
          iconScale={0.6}
        />
      </Flex>
    </ChakraProvider>
  );
};

export { IconBox, IconBoxExamples };
export default IconBoxExamples;
